import {
    checkAuthRes
} from '../utility';

$.ajax({
    url: END_POINT + "users/me",
    success: (res, textStatus, xhr) => {
        checkAuthRes(xhr);
        $(".img-profile").attr("src", res.path_img);
        $(".profile-text").html(`${res.fname} ${res.lname}`);
    },
    error: (res) => {

    }
})
